// let's go!
import React from 'react';
import { render } from 'react-dom';

class StorePicker extends React.Component {
    constructor(props) {
      super(props);
      // initialize state here
      this.state = {
        name: "erwin"
      }
    }
    render() {
      return (
        <div>
          <h1>{this.state.name}</h1>
        </div>
      );
    }
  };

  ReactDOM.render(<StorePicker />, document.getElementById('main'));
